script: |
  super -f tsv -I q2649.sql | sort > q2649.out

vector: true

inputs:
  - name: q2649.sql
    data: |
      SELECT DISTINCT - + COUNT ( * ), 60 AS col2 FROM tab1 AS cor0 WHERE NOT - col0 + - col2 NOT BETWEEN col0 + - CAST ( + col2 AS INTEGER ) AND - - col1;
  - name: tab1

outputs:
  - name: q2649.out
    data: |
      0	60
